import Box from '@mui/material/Box';
import { styled } from '@mui/system';

const BackgroundBox = styled(Box)({
    height: '100%',
    minHeight: '740px',
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
});

export default BackgroundBox;
